import React, { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { toggleMenu } from '../utils/appSlice'
import { YOUTUBE_AUTOSEARCH_API } from '../utils/constants';
import { cacheResults } from '../utils/searchSlice';

const Header = () => {
  const dispatch = useDispatch();
  const searchCache=useSelector((store)=>store.search)
  const [searchQuery, setSearchQuery] = useState("");
  const [suggestions, setSuggestions] = useState([]);
  const [showSuggestion, setShowSuggestion] = useState(false);
  const toggleMenuHandler=() => {
    // console.log('toggleMenuHandler');
    dispatch(toggleMenu());
  }

  useEffect(()=>{
   
   const timer = setTimeout(() => {
    console.log("searchCache[searchQuery]", searchCache[searchQuery])
    if(searchCache[searchQuery]){
      
      setSuggestions(searchCache[searchQuery]);
    }else{
      // getSearchData();
    } 
   }, 200);

  return ()=>{ 
    clearTimeout(timer)};

  },[searchQuery]);

  const getSearchData = async() => {
      const data = await fetch(YOUTUBE_AUTOSEARCH_API+searchQuery);
      const json = await data.json();
      console.log("==get serach",json.items);//snippet//title
      setSuggestions(json.items);
      dispatch(cacheResults({
        [searchQuery]:json.items
      }));
  }

  console.log('searchQuery suggestions',suggestions);
  return (
    <div className='grid grid-flow-col m-2 p-3 shadow-lg'>
      <div className='flex col-span-2'>
        <a href='javascript:void(0)'> <img className='h-8 cursor-pointer ' onClick={()=>toggleMenuHandler()} alt="Hambur"  src='https://www.svgrepo.com/show/316358/menu-hamburger.svg' />     
        </a> <img className='h-8 mx-2' alt="youtube logo"  src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTjdB5idttrtpfZkhv3Dz20jvA14SXgOCOKQiBT6_tnEyagCBi91sEJMTU8X6eLxzb5dQ&usqp=CAU' />
      </div>
      <div className='col-span-8 px-10'>
        <div>
         <input type='text'
         value={searchQuery}
         onChange={(e)=>setSearchQuery(e.target.value)}
          className='w-1/2  border border-gray-600 p-2 rounded-l-full' placeholder='Search'
          onFocus={()=>setShowSuggestion(true)}
          onBlur={()=>setShowSuggestion(false)}
           />
         <button className='border rounded-r-full border-gray-600 px-5 py-2 bg-gray-100'> <i class="fa-solid fa-magnifying-glass"></i>Search
          </button>
      </div>     
      {showSuggestion && <div className="fixed bg-white py-2 px-5 w-[22.5rem] rounded-lg shadow-lg border
        border-gray-100">
          <ul>
          {suggestions.length && suggestions.map((item)=>
            <li className='py-2 shadow-sm hover:bg-gray-100'><i class="fa-solid fa-magnifying-glass"></i>{item.snippet.title}</li> 
          )}
            
          </ul>
      </div>
      }
      </div>    
      <div className='col-span-2'>
         <img className='h-8' alt="user icon"  src='data:image/png;base64,' />
      </div>
    </div>
  )
}

export default Header
